import React from 'react'
import Navbar from './Navbar'

function Layout(props) {
    return(
        <React.Fragment>
            
            {(this.props.location.pathname != '/profile/' ? <Navbar/> : <></>)}
            {props.children}
        </React.Fragment>
    )
}

export default Layout
